INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(29, 'Bola Mikasa V200W', 'vôlei de quadra  bola ofical indicação: competição | profissionais e amadores  aprovada pela fivb - federação internacional de voleibol - é utilizada nos campeonatos mundiais, olimpíadas e principais competições. É também a bola oficial da cbv - confederação brasileira de voleibol. produzida em sistema de microfibra com tecnologia double dimple minimiza a resistência do ar e maximiza a precisão da bola, dando um maior controle ao jogador. sua tecnologia nano ballon silica previne a superfície da bola de se tornar escorregadia devido ao suor e sua superfície super composite cover propicia um maior grip e uma maior sensação de aderência.      18 painéis aerodinâmicos | painel microfibra     tamanho 5 - oficial     circunferência: 65-67cm     peso: 260-280g     laminada com uma tecnologia diferenciada para um melhor deslize e com tratamento antibactericida', 10, 899.99, , 's', 'Acessorios');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(31, 'Uniforme Seleção Brasileira de Vôlei Masculino', 'que história você quer escrever hoje? embarque na camiseta masculina de volêi cbv verde | vôlei brasil + bodywork by riachuelo e torça para os nossos meninos de ouro como se estivesse em quadra também. feita de poliéster e elastano, a camiseta é leve, foi inspirada em pinturas de povos originários de nosso país, possui gola com listra, manga curta com patrocínios e seus detalhes fazem a diferença: as estrelas posteriores representam as conquistas olímpicas masculina e feminina e a frase', 10, 179.90, , 's', 'Vestuario');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(32, 'Tênis Nike Giannis Immortality 3', 'Não importa a façanha, não importa o objetivo alcançado, o Greek Freak sempre mantém seus países de origem perto de seu coração. Nós misturamos as cores azul, verde e branco das bandeiras da Nigéria e da Grécia, terras nativas de Giannis, e as colocamos neste exclusivo Giannis Immortality 3. Cuidadosamente feito para o jogo de alta velocidade e sem posição de hoje, ele é mais macio do que a iteração anterior com um padrão de tração específico que é perfeito para dar o passo perfeito do Euro a caminho da glória.  Vá para o Basquete  Consegue ver as ranhuras se dividindo no meio do solado? Elas oferecem mais flexibilidade para facilitar os movimentos de um lado para o outro, como o passo Euro, esteja você em transição ou girando em torno de um defensor na cesta.  Passada suave  Tornamos a espuma da entressola mais macia do que o Giannis Immortality 2, para uma experiência mais flexível sob os pés ao correr no chão e preencher as pistas.  Sensação de segurança  Uma tira sintética no mediopé ajuda a manter o pé firme ao se mover de um lado para o outro. O cabedal utiliza um mesh leve e respirável para ajudar a manter os seus pés frescos.  Calce e Saia  O laço de puxar grande no calcanhar ajuda você a deslizar no calçado de forma rápida e fácil.', 10, 699.99, , 's', 'Calcados');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(33, 'Uniforme Seleção Brasileira de Vôlei Feminino', 'que história você quer escrever hoje? embarque na regata feminina de volêi cbv amarela | vôlei brasil + bodywork by riachuelo e torça para as craques de voleibol como se estivesse em quadra também. feita de poliéster e elastano, a regata é leve, foi inspirada em pinturas de povos originários de nosso país, possui gola com listra, patrocínios e seus detalhes fazem a diferença: as estrelas posteriores representam as conquistas olímpicas masculina e feminina e a frase interna na barra', -1, 159.99, , 's', 'Vestuario');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(39, 'Joelheira Asics Volei Profissional Slider Branca - Par', 'a joelheira slider tem cobertura total do joelho e zonas de flexibilidade. a peça é essencial para o dia a dia dos atletas de vôlei que buscam conforto e segurança para arrasar nas quadras.  nome: joelheira slider  gênero: unissex  indicado para: jogo  tipo: joelheira  composição: 46 algodão, 36 elastodieno e 18 poliéster  dimensões aproximadas: (axl): 25x 21 cm.  itens inclusos: 2 joelheiras.  tamanho unico', 11, 84.99, , 's', 'Acessorios');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(41, 'Tênis Nike Giannis Immortality 3 Verde', 'Não importa a façanha, não importa o objetivo alcançado, o Greek Freak sempre mantém seus países de origem perto de seu coração. Nós misturamos as cores azul, verde e branco das bandeiras da Nigéria e da Grécia, terras nativas de Giannis, e as colocamos neste exclusivo Giannis Immortality 3. Cuidadosamente feito para o jogo de alta velocidade e sem posição de hoje, ele é mais macio do que a iteração anterior com um padrão de tração específico que é perfeito para dar o passo perfeito do Euro a caminho da glória.  Vá para o Basquete  Consegue ver as ranhuras se dividindo no meio do solado? Elas oferecem mais flexibilidade para facilitar os movimentos de um lado para o outro, como o passo Euro, esteja você em transição ou girando em torno de um defensor na cesta.  Passada suave  Tornamos a espuma da entressola mais macia do que o Giannis Immortality 2, para uma experiência mais flexível sob os pés ao correr no chão e preencher as pistas.  Sensação de segurança  Uma tira sintética no mediopé ajuda a manter o pé firme ao se mover de um lado para o outro. O cabedal utiliza um mesh leve e respirável para ajudar a manter os seus pés frescos.  Calce e Saia  O laço de puxar grande no calcanhar ajuda você a deslizar no calçado de forma rápida e fácil.', 10, 699.99, , 's', 'Calcados');
