(45, 'Camisa do Palmeiras I 23 Masculina Puma Torcedor', 'Composição do Tecido	Poliéster\r\nConteúdo da Embalagem	1 Camisa\r\nRespirabilidade	Sim\r\nGarantia do Fornecedor	Contra Defeito de Fabricação\r\nTime	Palmeiras\r\nSAC do Fornecedor	PUMA: (11) 2135-9999\r\nGola	Canelada\r\nTira interna que diminui o atrito de contato junto à pele\r\nCareca\r\nEstampa	Personalizada\r\nTipo de Manga	Manga Curta\r\nEscudo	Clube\r\nOrigem do Time	Nacional', 13, 219.99, , 's', 'Vestuario');
