INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(48, 'Bola de Vôlei Penalty Pro 8.0 Termotec', 'Para os amantes do Voleibol, a Bola de Vôlei Penalty Pro 8.0 Termotec ideal para suas partidas, seja nos treinos ou momentos de lazer. Desenvolvida com materiais de qualidade, oferece melhor desempenho nas quadras. Além disso, a Bola de Vôlei Penalty Pro 8.0 conta com Termotec, sistema que não absorve à água permitindo que seja usada em meio chuva intensa e cápsula SIS que protege a câmara e isola a agulha, tecnologias essas que reforçam a qualidade Penalty. Compre hoje mesmo no site ou aplicativo Centauro!', 23, 398.90, , 's', 'Acessorios');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(49, 'Bola de Basquete Wilson NBA DRV', 'Aprovada pelos melhores craques, da bola de Basquete Wilson NBA DRV possui estrutura emborrachada texturizada e reforçada que contribui para o melhor desempenho durante jogos/partidas, principalmente nas quadras. A bola de basquete possui ainda ótima aderência que oferece firmeza e estabilidade durante os lances e enterradas na cesta. Além disso, a bola Wilson apresenta o logo da marca em destaque que confere a qualidade do produto. Não perca a oportunidade e adquira já sua bola!\r\n\r\nPor questões de segurança no transporte, as bolas serão enviadas vazias.', 12, 119.99, , 's', 'Acessorios');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(50, 'Camisa do Brasil Nike Torcedor Pro I 22/23 - Masculina', 'Camisa do Brasil Nike Torcedor Pro I 22/23 - Masculina\r\n\r\nAssim como outras camisas da nossa coleção Stadium, esse modelo combina detalhes de design de réplica com tecido que absorve o suor para oferecer um visual preparado para o jogo e inspirado na sua seleção favorita.\r\n\r\nBenefícios\r\n\r\n    Tecnologia Nike Dri-FIT absorve o suor da sua pele para evaporação mais rápida, ajudando a manter você seco e confortável.\r\n    O design de réplica é baseado naquele que os craques usam em campo.\r\n\r\nDetalhes do Produto\r\n\r\n    100% poliéster\r\n    Lavável à máquina\r\n    Importado\r\n\r\nTamanho & Caimento\r\n\r\n    Produto com modelagem justa.\r\n\r\n    Considere adquirir um tamanho maior caso deseje um caimento mais solto.', 10, 179.99, , 's', 'Vestuario');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(51, 'Bola de Futebol de Campo Nike Pitch Training', 'TREINE DURO.\r\nA Bola de Futebol Nike Pitch Training possui design durável criado para as sessões de treino e para aperfeiçoar suas habilidades.\r\n\r\nA estampa de alto contraste facilita a visualização da bola no ar e no chão.\r\nBenefícios: Parte externa lisa e durável, com toque consistente. A estampa de alto contraste facilita a visualização da bola. Câmara em borracha ajuda a manter a pressão do ar e o formato.\r\nDetalhes do produto: Modelo com 12 painéis. 60% borracha/15% poliuretano/13% poliéster/12% EVA. Importado', 16, 89.99, , 's', 'Acessorios');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(52, 'Tênis Vans Masculino Ward Canvas', 'Incremente seu look, com esse Tênis Vans Ward Canvas. Versátil, o tênis te acompanha tanto no dia a dia, quanto nas pistas de skate. Seu cabedal (parte superior do tênis) com estrutura em lona (100% algodão), oferece conforto e apoio em todos os momentos. Já seu solado e entressola são emborrachados, que garantem aderência e estabilidade em todas as superfícies. E para complementar, a qualidade Vans pode se encontradas em todos os detalhes do calçado. Não perca a chance e compre já!', 12, 399.99, , 's', 'Calcados');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(53, 'Chinelo Nike Air Max Cirro - Slide - Adulto', 'Moderno e cheio de estilo, o chinelo Nike é a escolha perfeita para montar aquele look despojado.\r\n\r\nEstruturado com material de alta qualidade, o chinelo possui tira única produzida em macia e confortável, além de solado emborrachado antiderrapante que garante ótima aderência em diferentes tipos de pisos.\r\n\r\nE para complementar, a tecnologia Nike Air: Sistema Air de amortecimento, que se espalha por todo o solado, absorve forças de impacto e guia o pé com segurança.\r\n\r\nNão perca a chance e confira já!', 23, 269.99, , 's', 'Calcados');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(54, 'Kit de Meias Cano Alto Nike Everyday Cushioned Crew com 3 Pares - Adulto', 'De gênero unissex, esse prático Kit de Meias Nike Everyday Cushioned Crew é uma excelente opção para os treinos esportivos e também para uso casual. Com tecnologia Dri-Fit, que mantém os pés secos e confortáveis, as Meias Nike são confeccionadas com materiais de ótima qualidade que combinam leveza, durabilidade e ótima elasticidade. Já a sola é atoalhada com ajuste canelado no arco do pé que evita o deslocamento da meia. Além disso, o kit possui 03 pares de meias que facilitam a troca e limpeza, conferindo looks criativos e versáteis. Não perca a chance e aproveite o ótimo preço para comprar o seu kit de meias Nike. Compre já!', 12, 99.99, , 's', 'Vestuario');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(65, 'Nike Streak Dri-Fit Volleyball Knee Pads', 'As joelheiras Nike oferecem amortecimento macio no treinamento para praticar resgates de bola e evitar o ponto do time rival, com proteção para os joelhos e reduzir o atrito irritante nos joelhos, arranhões e cicatrizes ao dar tudo no jogo. Material perfeito para treinamento. Eles são feitos com um tecido macio para permanecer confortável e elástico que se adapta ao seu corpo para maior flexibilidade quando você está para cima e para baixo em cada jogada, o material acolchoado de espuma EVA e um tecido com tecnologia Nike absorvente para reduzir o suor. a pele. Sinta-se confortável em cada movimento de defesa com acessórios Nike', 12, 381.04, , 's', 'Vestuario');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(66, 'Chuteira do Neymar Jr FG/AG Campo Puma Future Z 1.4 - Adulto', 'Inspire-se no craque Neymar Jr com essa chuteira de campo Puma.\r\n\r\nO Cabedal(Parte Superior do Calçado) em material resistente, proporcionando suporte e apoio dentro das quatro linhas.\r\n\r\nA chuteira apresenta forro interno em têxtil com reforço acolchoado para maior proteção.\r\n\r\nAlém disso, o solado TPU com travas altas que oferece maior aderência e excelente tração.\r\n\r\nNão perca a oportunidade e compre hoje sua chuteira!', 3, 899.99, , 's', 'Calcados');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(67, 'Chuteira de Campo Nike Zoom Superfly 9 Elite - Adulto', 'Chuteira de Campo Nike Zoom Superfly 9 Elite - Adulto\r\n\r\nCristiano Ronaldo não poderia ir em busca de seu sonho sozinho.\r\n\r\nTreinadores, familiares e modelos ajudaram a torná-lo a estrela que ele é hoje.\r\n\r\nCelebre as pessoas que o motivaram ao longo do caminho.\r\n\r\nLavanda floral e amarelos eletrizantes lembram você de deixar as inspirações saberem que são amadas e apreciadas.\r\n\r\nAdicionamos uma unidade Zoom Air e textura aderente na parte superior para um toque excepcional, para que você possa dominar nos minutos finais de uma partida - quando mais importa.\r\n\r\nMostre Seu Amor\r\n\r\nAs flores são um símbolo de onde tudo começou e da jornada percorrida desde então.\r\n\r\nSão uma forma de homenagear aqueles que o influenciaram e ajudaram, de reconhecer aqueles que compartilham seu fogo competitivo.\r\n\r\nTons digitais em camadas com mudança de cores e tons metálicos adicionam profundidade a um gráfico de flor distorcido.\r\n\r\nSensação Flexível Embaixo do Pé\r\n\r\nA unidade Zoom Air em 3/4 do comprimento fica em cima da placa e proporciona um nível adicional de sensação de flexibilidade embaixo do pé que te ajuda a se movimentar mais rápido em campo.\r\n\r\nEla cria separação quando mais importa - quer esteja marcando gols, sendo o primeiro a chegar na bola ou passando pela defesa.\r\n\r\nMergulhe, Decole\r\n\r\nTravas com estrela de três pontas proporcionam tração multidirecional a cada passo para que você possa mudar de direção rapidamente e com confiança.\r\n\r\nAs travas no calcanhar proporcionam tração e estabilidade na frenagem.\r\n\r\nTravas centrais proporcionam tração durante partidas explosivas.\r\n\r\nAjuste Aprimorado\r\n\r\nO Flyknit envolve o tornozelo em um tecido macio e elástico para uma sensação de segurança.\r\n\r\nUm design refeito melhora o ajuste, para simular melhor o pé.\r\n\r\nFizemos isso realizando vários testes de desgaste em centenas de atletas.\r\n\r\nO resultado é uma biqueira mais contornada e melhor fixação no calcanhar.\r\n\r\nSinta a Bola\r\n\r\nO cabedal é feito de Vaporposite+, que combina um mesh aderente com um forro premium para excelente controle de bola em altas velocidades.\r\n\r\nO forro proporciona uma sensação tátil na superfície do cabedal.\r\n\r\nÉ macio, mas estável e envolve seu pé com firmeza.\r\n\r\nA flexibilidade oferece uma sensação mais natural na bola para arremessar, driblar ou passar.\r\n\r\nDirecione sua Velocidade\r\n\r\nA gaiola de velocidade dentro da estrutura é feita de um material fino, mas forte, que prende o pé ao solado sem colocar peso adicional para um bloqueio ideal.\r\n\r\nDetalhes do Produto\r\n\r\n    Para uso em campos com gramado curto, levemente úmidos.\r\n    Palmilha acolchoada', 5, 0.00, , 's', 'Calcados');
INSERT INTO `produtos` (`pro_id`, `pro_nome`, `pro_descricao`, `pro_quantidade`, `pro_valor`, `pro_imagem`, `pro_ativo`, `pro_categoria`) VALUES
(68, 'Tênis Asics Gel-Rocket 11 - Masculino', 'Tênis Asics Gel-Rocket 11 - Masculino\r\nO estilo GEL-ROCKET 11 é um sapato de quadra indoor multiuso que oferece boa estabilidade e movimento fácil para uma variedade de atletas de quadra. Este sapato é projetado com uma construção superior flexível que é respirável e mais confortável.Uma aplicação de TPU TRUSSTIC na entressola foi projetada para ajudar a resistir à torção excessiva e melhorar a estabilidade durante transições rápidas.Sua sola envolvente e estabilizador são componentes de suporte funcionais que são úteis durante os movimentos de um lado para o outro. Enquanto isso, os sulcos de flexão do solado proporcionam maior flexibilidade para ajudá-lo a se movimentar com mais liberdade na quadra. ESPECIFICAÇÕES TÉCNICAS - Cabedal em Mesh e Sintético - Forro em Têxtil com Reforço Acolchoado - Entressola em TPU TRUSSTIC - Solado em Borracha Non Marking', 16, 549.00, , 's', 'Calcados');

